import React from "react";
import Card from "Card";

function App() {
  return <div>
    <Card name="Beyonce"
      imgURL=
      "https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg"
      phone="+123 456 789"
      email="b@beyonce.com" />
  </div>
}
export default App;
